California is the seventh studio album by American rock band Blink-182, released on July 1, 2016 through BMG as the band's only album on the label. Produced by John Feldmann, it is the first album by the band to feature Alkaline Trio frontman Matt Skiba, who replaced former member Tom DeLonge. 
